              return item !== e.target.value
          }); console.log(form.genre)}}
           />
           <label htmlFor="love" className="form-check-label">love</label>
         </div>
       </div>
       <div className="form-group">
         <input
           type="submit"
           value="Create person"
           className="btn btn-primary"
         />
       </div>
     </form>
   </div>
 );
}
